// src/app/pages/Results1/Results1.jsx
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import DonutChart from '../../components/DonutChart/DonutChart';
import './Results1.scss';

// You would replace this with your actual data from backend
const mockData = {
  topicQuestion: "Explain the concept of judicial review and its significance in U.S. law.",
  chartPercentage: 73,
  conceptBreakdown: [
    { name: "UNCLOS", color: "#B8F5B1", value: 40 },
    { name: "Exclusionary Rule", color: "#F5756B", value: 20 },
    { name: "Doctrine of Precedent", color: "#345B79", value: 15 },
    { name: "Hearsay Rule", color: "#E5EBF0", value: 25 }
  ],
  className: "Business Association",
  professorName: "LAWID B"
};

const Results1 = () => {
  const [currentIndex, setCurrentIndex] = useState(0);

  const handlePrevious = () => {
    setCurrentIndex(prev => Math.max(prev - 1, 0));
  };

  const handleNext = () => {
    // In a real application, you would check against the total number of results
    setCurrentIndex(prev => prev + 1);
  };

  return (
    <div className="results1-container">
      <header className="results1-header">
        <div className="logo-container">
          <img 
            src="/classinsight-logo.png" 
            alt="Class Insight Logo" 
            className="logo"
            onError={(e) => {
              e.target.onerror = null;
              e.target.style.display = 'none';
              e.target.nextSibling.style.display = 'block';
            }}
          />
          <div className="logo-text" style={{ display: 'none' }}>CLASS INSIGHT</div>
        </div>
        <nav className="main-nav">
          <Link to="/new-assignment" className="nav-item">New Assignment</Link>
          <Link to="/past-assignments" className="nav-item">Past Assignments</Link>
          <Link to="/ai-settings" className="nav-item">AI Settings</Link>
          <Link to="/classes" className="nav-item">Classes</Link>
        </nav>
        <div className="user-info">
          <div className="class-dropdown">
            <span>{mockData.className}</span>
            <span className="dropdown-arrow">â–¼</span>
            <div className="professor-name">{mockData.professorName}</div>
          </div>
          <div className="user-avatar">
            <img 
              src="/avatar-placeholder.png" 
              alt="User" 
              onError={(e) => {
                e.target.onerror = null;
                e.target.innerHTML = "ðŸ‘¤";
              }}
            />
          </div>
        </div>
      </header>

      <main className="results1-main">
        <div className="results-header">
          <h1>Results</h1>
          <div className="results-actions">
            <button className="question-index-btn">Q1</button>
            <button className="export-btn">Open CSV</button>
          </div>
        </div>

        <div className="topic-question">
          {mockData.topicQuestion}
        </div>

        <div className="chart-container">
          <button className="nav-btn prev-btn" onClick={handlePrevious}>
            &lt;
          </button>

          <div className="donut-chart">
            <DonutChart 
              percentage={mockData.chartPercentage} 
              segments={mockData.conceptBreakdown} 
            />
          </div>

          <div className="chart-legend">
            {mockData.conceptBreakdown.map((concept, index) => (
              <div key={index} className="legend-item">
                <div className="legend-color" style={{ backgroundColor: concept.color }}></div>
                <div className="legend-name">{concept.name}</div>
              </div>
            ))}
          </div>

          <button className="nav-btn next-btn" onClick={handleNext}>
            &gt;
          </button>
        </div>

        <div className="results-actions-bottom">
          <button className="download-btn">
            <span className="download-icon">â†“</span>
          </button>
          <button className="share-btn">
            <span className="share-icon">â†—</span>
          </button>
        </div>
      </main>
    </div>
  );
};

export default Results1;
